--
-- Table structure for table `drugpay`
--

DROP TABLE IF EXISTS `drugpay`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `drugpay` (
  `DrugPayID` int(11) NOT NULL AUTO_INCREMENT,
  `PayTime` datetime DEFAULT NULL COMMENT '支出時間',
  `DrugCode` varchar(10) NOT NULL COMMENT '藥品代碼',
  `CodeID` varchar(1) NOT NULL COMMENT '支出代碼',
  `LotNumber` varchar(10) NOT NULL COMMENT '製造批號',
  `StoreType` varchar(1) NOT NULL COMMENT '儲區類別',
  `StoreID` varchar(10) NOT NULL COMMENT ' 儲區編號',
  `AreaNo` tinyint(4) DEFAULT '0' COMMENT '儲位編號',
  `BlockNo` tinyint(4) DEFAULT '0' COMMENT '隔間編號',
  `PayQty` decimal(8,2) DEFAULT NULL COMMENT '支出數量',
  `DrugPermitNO` varchar(20) DEFAULT '' COMMENT '許可證字號',
  `MakerID` varchar(11) DEFAULT '' COMMENT '製造商代碼',
  `MakerName` varchar(50) DEFAULT '',
  `ResearchPlan` varchar(40) DEFAULT '' COMMENT '研究試驗計畫名稱',
  `DocNumber` varchar(20) DEFAULT '' COMMENT '文號',
  `Remark` varchar(60) DEFAULT '' COMMENT '備註',
  `UserID` varchar(20) NOT NULL COMMENT '使用者代碼',
  `ShiftNo` varchar(2) NOT NULL COMMENT '班次',
  `DrugName` varchar(80) DEFAULT NULL,
  `DrugEnglish` varchar(100) DEFAULT NULL,
  `EffectDate` date DEFAULT NULL,
  `StockQty` decimal(8,2) DEFAULT NULL,
  PRIMARY KEY (`DrugPayID`),
  KEY `DrugPay_IDX1` (`PayTime`),
  KEY `DrugPay_IDX2` (`DrugCode`,`PayTime`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
